// components/Header.js
import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import { FaUser, FaSignOutAlt } from 'react-icons/fa';

const Header = () => {
    const navigate = useNavigate();

    const handleLogout = () => {
        // Perform logout logic
        navigate('/login');
    };

    return (
        <Navbar bg="light" expand="lg">
            <Container>
                <Navbar.Brand onClick={() => navigate('/')}>Nutritracker</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="me-auto">
                        <Nav.Link onClick={() => navigate('/')}>Home</Nav.Link>
                        <Nav.Link onClick={() => navigate('/search')}>Add Food</Nav.Link>
                        <Nav.Link onClick={() => navigate('/custom-foods')}>Custom Foods</Nav.Link>
                        <Nav.Link onClick={() => navigate('/custom-recipes')}>Custom Recipes</Nav.Link>
                    </Nav>
                    <Nav>
                        <Nav.Link onClick={() => navigate('/profile')}><FaUser /></Nav.Link>
                        <Nav.Link onClick={handleLogout}><FaSignOutAlt /></Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
};

export default Header;
